import Item from '../Components/Item';
import clsx from 'clsx';
import React from 'react'
import styles from '../Styles/Wesushi.module.css'
function Wesushi({number}) {
    return (
        <div className="content">
            <div className="Banner">
                <img className={clsx(styles.Banner_img)} src="https://assets.weluck.vn/banners/shopping_category/SUSHI_Header_1642142595574.jpg" alt="Banner"></img>
            </div>
            <div className="container">
                <Item number={number}/>
            </div>
        </div>
    )
}

export default Wesushi;
